import React,{useState} from 'react'
import DropdoqnSidebar from '../components/SidebarCompo';
import NavigationBar from '../components/Navigation';

const Home = () => {

    const[ isOpen,setIsOpen ] = useState(false)

    const toggle = () =>{
        setIsOpen(!isOpen);
    };

    return (
        <>
            <DropdoqnSidebar/>
            <NavigationBar/>
        </>
    )
}

export default Home
